import React, { Component } from 'react';
import Add_team from './Add_team';
import '../../App.css';

export default class Not_member extends Component {
    constructor(props) {
        super(props);
        this.state = {
           create: false
        }
     }

    render() {
        return (
            <>
                <div className='team'>
                    Vous n'êtes pas encore membre d'une équipe.
                    <br></br>
                    <button className='btn-team' >Créer une équipe</button>
                    <button className='btn-team' >Rejoindre une équipe</button>
                </div>
            </>
        )
    }
}
